import IndexMenu from "./indexMenu";

export default function renderIndexMenu(data, item, filteredSearch, profile) {
  // console.log(data, item. filteredSearch)
  let type = data['display'][profile]
  let device = item[profile]
  let index = data['index'][profile]
  let list = filteredSearch['device']['relevant']

  if (type) {
    if (!type['highlighted'] && !data['display']['nonehighlighted']) return <div></div>

    if (device.length === 0) return <div></div>

    return <IndexMenu
      list={list} 
      index1={index[0]} 
      index2={index[1]} 
      index3={index[2]} 
      index4={index[3]} 
      index5={index[4]}
      index6={index[5]}
      index7={index[6]}
    />
  }
}
